export async function getUsedMarket() {
  try {
    // API 호출을 위한 fetch 사용
    const response = await fetch(
      "https://panda-market-api.vercel.app/products"
    );

    // 응답의 JSON 데이터 추출
    const body = await response.json();

    // 데이터 반환
    return body;
  } catch (error) {
    // 오류 발생 시 적절히 처리
    console.error("Error fetching used market data:", error);
    throw error;
  }
}
